@Lucas I love it! Very well done!
I noted the "approve and sent" pattern as 2 seperate transactions, just wanted to let you know we'll be able to allow multicall/batch transactions with `alpha5, cairo-v0.7.0` which is expected by end of december! After that it should be possible to do both steps (and more!) in a single transaction
Enjoy your holidays!

