Hello everyone,
An open source project I developed was online, website is: https://zk-ns.xyz
open code: https://github.com/zk-ns/zk-name-service--cairo1.0
This is a decentralized community domain name project. Here, users can purchase and use domain name services at extremely low prices. It only costs 0.001ETH to purchase a 6-digit domain name a year, which is about 1.8 USDT.
After the user purchases the domain name, he is immediately eligible to mint governance tokens (NGT Token). The total amount of governance tokens is 1.1 billion, of which 1 billion are minted after purchasing domain names, and 100 million are used for user pledge mining. The distribution of 1.1 billion is fair. Only users who purchase domain names are eligible to mint coins. The developer share is 0, which is completely decentralized.

About Minting Shares
The user minting actually gets 80% of the shares, the other 10% is given to the promoters, and 10% is given to the community leader.
For example:
Users spend 0.001ETH to purchase a domain name with 6 digits or above for 1 year, can mint 1,000 NGTs, actually get 800 NGTs, promoters get 100 NGTs, and community leaders get 100 NGTs;
Users spend 0.002ETH to purchase a domain name with 6 digits or above for 2 years, can mint 2,000 NGTs, actually get 1,600 NGTs, promoters get 200 NGTs, and community leaders get 200 NGTs;
Users spend 0.002ETH to purchase a 5-digit domain name for 1 year, can mint 2,000 NGTs, actually get 1,600 NGTs, promoters get 200 NGTs, and community leaders get 200 NGTs;
Users spend 0.004ETH to purchase a 5-digit domain name for 2 years, can mint 4,000 NGTs, actually get 3,200 NGTs, promoters get 400 NGTs, and community leaders get 400 NGTs;
